import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import DoctorNavbar from '../../components/DoctorNavbar';
import DoctorFooter from '../../components/DoctorFooter';
import DoctorCalendar from '../../components/DoctorCalendar';

const DoctorResched = () => {
  const { appointmentId } = useParams();
  const [rescheduleChoice, setRescheduleChoice] = useState('');
  const [error, setError] = useState('');
  const [rescheduleStatus, setRescheduleStatus] =  useState('');
  const [latestAppointment, setLatestAppointment] = useState([
    {
      title: '',
      clinic: '',
      address: '',
      number: '',
      start: new Date(),
      end: new Date(),  // 5:00 PM
      transactionNo: '',
      appointmentStatus: ''
    },
  ]);
  const [appointments, setAppointments] = useState([
    {
      title: '',
      clinic: '',
      address: '',
      number: '',
      start: new Date(),
      end: new Date(),  // 5:00 PM
      transactionNo: '',
      appointmentStatus: ''
    },
  ]);

  useEffect(() => {
    fetch('http://localhost:8080/checkLoggedInDoctor')
      .then((response) => {
        if (response.ok) {
          return response.json();
        }
        throw new Error('Network response was not ok');
      })
      .then((data) => {
        // Once you have the patientUserId, make another request to get appointments
        fetch(`http://localhost:8080/appointments?doctorUserId=${data}`)
          .then((appointmentsResponse) => {
            if (appointmentsResponse.ok) {
              return appointmentsResponse.json();
            }
            throw new Error('Network response was not ok');
          })
          .then((appointmentsData) => {
            const formattedAppointments = appointmentsData.map((appointment) => {
              // Extract date and time components
              const [year, month, day] = appointment.scheduleDate.split('-').map(Number);
              const [hours, minutes] = appointment.startTime.split(':').map(Number);
              const [hours2, minutes2] = appointment.endTime.split(':').map(Number);

              // Create Date objects for start and end times
              const startDate = new Date(year, month - 1, day, hours, minutes);
              const endDate = new Date(year, month - 1, day, hours2, minutes2);

              // Create an appointment object
              return {
                title: appointment.patientName,
                clinic: appointment.clinicName,
                address: appointment.address,
                number: appointment.clinic.officeNumber,
                start: startDate,
                end: endDate,
                appointmentId: appointment.transactionNo,
                appointmentStatus: appointment.status
              };
            });

            setAppointments(formattedAppointments);
          })
          .catch((error) => {
            // Handle errors
            console.error(error);
          });

      })
      .catch((error) => {
        console.error('Error:', error);
      });
  }, []);


  return (
    <div>
      <DoctorNavbar />
        <div style={{ display: "flex", margin: "auto", width: "100vw", justifyContent: "center" }}>
            <DoctorCalendar />

            <div style={{ marginLeft: "30px" }}>
              <h1>My Appointments : <br/>Clinic</h1>
              <table>
                <tr><b>Juan Santos Santiago</b></tr>
                <tr>
                  <td> Date: 
                    <select name="sched" id="sched">
                    <option value="11/13/2023">November 13, 2023 (MONDAY)</option>
                    <option value="11/20/2023">November 20, 2023 (MONDAY)</option>
                    <option value="11/27/2023">November 27, 2023 (MONDAY)</option>
                    <option value="12/04/2023">December 4, 2023 (MONDAY)</option>
                  </select>
                  </td>
                </tr>
                <tr>
                <td>Time:  
                  <select name="time" id="startTime">
                    <option value="08:00:00">8:00 AM</option>
                    <option value="09:00:00">9:00 AM</option>
                    <option value="10:00:00">10:00 AM</option>
                    <option value="11:00:00">11:00 AM</option>
                    <option value="12:00:00">12:00 PM</option>
                    <option value="13:00:00">1:00 PM</option>
                    <option value="14:00:00">2:00 PM</option>
                    <option value="15:00:00">3:00 PM</option>
                    <option value="16:00:00">4:00 PM</option>
                    <option value="17:00:00">5:00 PM</option>
                  </select>to
                  <select name="time" id="endTime">
                    <option value="08:00:00">8:00 AM</option>
                    <option value="09:00:00">9:00 AM</option>
                    <option value="10:00:00">10:00 AM</option>
                    <option value="11:00:00">11:00 AM</option>
                    <option value="12:00:00">12:00 PM</option>
                    <option value="13:00:00">1:00 PM</option>
                    <option value="14:00:00">2:00 PM</option>
                    <option value="15:00:00">3:00 PM</option>
                    <option value="16:00:00">4:00 PM</option>
                    <option value="17:00:00">5:00 PM</option>
                    </select></td>
                </tr>

                <tr><button style={{borderRadius: 0, width:"100%"}}>Submit</button></tr>
              </table>
            </div>

          </div>
          <DoctorFooter />
        </div>
      );
}

export default DoctorResched
